DROP TABLE IF EXISTS `proveedor`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `proveedor` (
  `id_proveedor` int(11) NOT NULL AUTO_INCREMENT,
  `Codigo_Proveedor` varchar(100) DEFAULT NULL,
  `Proveedor` varchar(200) DEFAULT NULL,
  `Cedula_Juridica` varchar(50) DEFAULT NULL,
  `Actividad` varchar(500) DEFAULT NULL,
  `Ubicacion` varchar(200) DEFAULT NULL,
  `id_corrreo` int(11) DEFAULT NULL,
  `id_fax` int(11) DEFAULT NULL,
  `id_fechas` int(11) DEFAULT NULL,
  `id_producto` int(11) DEFAULT NULL,
  `id_telefono` int(11) DEFAULT NULL,
  PRIMARY KEY (`id_proveedor`),
  KEY `fk_proveedor_fax_idx` (`id_fax`),
  KEY `fk_proveedor_telefono_idx` (`id_telefono`),
  KEY `fk_proveedor_correo_idx` (`id_corrreo`),
  KEY `fk_proveedor_fechas_idx` (`id_fechas`),
  CONSTRAINT `fk_proveedor_correo` FOREIGN KEY (`id_corrreo`) REFERENCES `correo` (`id_correo`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_proveedor_fax` FOREIGN KEY (`id_fax`) REFERENCES `fax` (`id_fax`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_proveedor_fechas` FOREIGN KEY (`id_fechas`) REFERENCES `fechas` (`id_fechas`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_proveedor_telefono` FOREIGN KEY (`id_telefono`) REFERENCES `telefono` (`id_telefono`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=718 DEFAULT CHARSET=utf8;
