CREATE DEFINER=`root`@`localhost` PROCEDURE `Correos`(
in _idcorreo int,
in _correo varchar(60),
in accion varchar(10)
)
BEGIN
#se crea un caso donde se pueden realizar los comandos
 case accion
 #se crea la accion nuevo el cual ingresara nuevos datos a la tabla
     when 'nuevo' then
      insert into correo(id_correo,correo)
      values (_idcorreo,_correo);
 #se crea un procedimiento el cual actualizara los datos    
     when 'editar' then
      update correo set
      correo=_correo
      where id_correo=_idcorreo;
 # se crea un procedimiento el cual elimine datos	
    when 'eliminar' then
    delete from correo  where id_correo=_idcorreo;
 # se crea un procedimiento de consulta
	when 'consultar' then
    select*from correo where id_correo=_idcorreo;
 # se finaliza el caso
    end case;
    
END ;;
DELIMITER ;
