CREATE DEFINER=`root`@`localhost` PROCEDURE `Proveedor`(
in _id int,
in _cod varchar(45),
in _nom varchar(45),
in _cel varchar(45),
in _descrip varchar(100),
in _ubi varchar (45),
in _act varchar(100),
in acc varchar(20)
)
BEGIN

case acc

when 'nuevo' then
insert into proveedor (id_proveedor,Codigo_Proveedor,Proveedor,Cedula_Juridica,Detalles,Actividad,Ubicacion)
values (_id,_cod,_nom,_cel,_descrip,_ubi,_act);

when 'editar' then
update proveedor set
Codigo_Proveedor=_cod, Proveedor=_nom,Cedula_Juridica=-cel,Detalles=_descrip,Actividad=_act,Ubicacion=_ubi
where id_proveedor=_id;

when 'consultar' then
select distinct proveedor.Codigo_Proveedor,Proveedor,Cedula_Juridica,Ubicacion,telefono.Telefono,fax.Fax,producto.Producto,Descripcion,fechas.Fecha_ingreso,Fecha_expira,correo.Correo
 from consulta.proveedor , consulta.telefono ,correo ,fax ,producto ,fechas
 where id_proveedor=_id;

when 'eliminar' then
delete from proveedor where id_proveedor=_id;

end case; 
END ;;
