CREATE DEFINER=`root`@`localhost` PROCEDURE `Proveedorconsultar`(
in _id int,
in _cod varchar(100),
in _nom varchar(200),
in _cel varchar(50),
in _descrip varchar(500),
in _act varchar(500),
in _ubi varchar (200),
in _tel varchar(45),
in _fax varchar(45),
in _correo varchar(200),
in _ingreso varchar(50),
in _expira varchar(50)

)
BEGIN
select 
Codigo_Proveedor,
Proveedor,
Cedula_Juridica,
Correo_1,Correo_2,Correo_3,
Telefono_1,Telefono_2,Telefono_3,
Fax_1,Fax_2,Fax_3,
fecha_expira,
fecha_ingreso
from 
(((proveedor
inner join telefono on proveedor.id_proveedor= telefono.id_telefono)
inner join correo on proveedor.id_proveedor= correo.id_correo)
inner join fax on proveedor.id_proveedor= fax.id_fax)
inner join fechas on proveedor.id_proveedor = fechas.id_fechas
 where id_proveedor=_id;
END ;;
