CREATE DEFINER=`root`@`localhost` PROCEDURE `Usuario`(
in _id int,
in _nom varchar(45),
in _contr varchar(45),
in acc varchar(20)
)
BEGIN
case acc

when 'nuevo' then
 insert into usuario (idusuario,Nombre,Contraseña)
 values (_id,_nom,_contr);
 
when 'editar' then
 update usuario set
 Nombre=_nom,Contraseña=_contr
 where idusuario=_id;

when 'consultar' then
 select*from usuario where idusuario=_id;
 
when 'eliminar' then
 delete from usuario where idusuario=_id;
 end case;

END ;;
DELIMITER ;
